 const name = 'John Doe';
 const jobTitle = 'Software Engineer';
 const department = 'Engineering';


 return (
    <div className="employee">
      <h3>{name}</h3>
      <p>{jobTitle}</p>
      <p>{department}</p>
    </div>
 );
}


export default employee;
